import MovieItem from "../movieItem/MovieItem";
import "./MovieList.css";

class MovieList extends React.Component {
  render() {
    return (
      <div className="movieList shadow mx-auto mt-4 p-1 rounded-2 bg-white">
        <MovieItem />
      </div>
    );
  }
}
export default MovieList;
